import React from 'react'

const Footer = () => {
  return (
    <>
      <h3
        className="text-secondary text-center my-3"
        style={{
          backgroundColor: "rgba(255, 255, 255, 0.234)",
          display: "block",
        }}
      >
        {" "}
        <span className="text-danger">**</span> Developed By Nitin Patil <span className="text-danger">**</span>
      </h3>
    </>
  )
}

export default Footer
